        bool found;
        int[0,MAX_ENEMIES] i, cont=0;
        EnemyID_t target_id;
        int[MIN_CELL_X,MAX_CELL_X] target_dist, d;
        int target_entering;

        if (targetable_enemies > 0)
            {
                i = 0;
                found = false;
